    false,nt"url": null,nt"notes": "This narrative report for Sunkhaze Meadows
    National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins by summarizing the year's highlights as well as weather
    conditions. Land acquisition is covered. The planning section discusses the master
    plan, management plan, public participation, and compliance with environmental and
    cultural resource mandates. Administration is described; topics include personnel
    and funding. The habitat management section discusses wetlands and forests. Wildlife-
    including wildlife diversity, endangered and threatened species, waterfowl, game
    mammals, other resident wildlife, and fisheries resources- is also covered. The
    public uses of the Refuge described in this report include hunting and other wildlife
    oriented recreation. The Refuge development and maintenance section discusses new
    construction, equipment utilization, and computer systems. Cooperative programs
    are discussed. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
